import { useState } from 'react';
import './App.css';

function App() {
  let element;
  const [isloggedin, setloggin] = useState(false);
  if (isloggedin) {
    element = <h1>Welcome to the website</h1>
  }
  else {
    element = <h5>Please login to continue</h5>
  }
  return (

    <div className="App">

      <button onClick={() => setloggin(true)}>Login</button>
      {element};
    </div >
  )
}

export default App;
